import { Pages } from '../models'
import { LoginFirebaseUI } from '../components/Login'
import { factory } from '@flashcards/client'

function getPageDependencies(pageDisplayName?: string) {
  switch (pageDisplayName) {
    case Pages.Login:
      return {
        LoginComponent: LoginFirebaseUI,
        loginWithProvider: factory.createLoginWithProvider(),
      }
    default:
      return {}
  }
}

export { getPageDependencies }
